`;

const ProfileImageContainer = styled.div`
  width: 40px;
  height: 40px;
  margin-right: 18px;
  border-radius: 50px;
  overflow: hidden;
  float: left;
`;

const Comment = ({ comment }) => {
  return (
    <>
      {comment}
    </>
  );
};

export default Comment;
